import Intro from './Intro'
import Footer from './Footer'
import Education from './Education'
import Projects from './Projects'
import Work from './Work'
import './App.css';

function App() {
  return (
      <><Intro />
        <Work/>
        <Projects />
        <Education />
        <Footer />
     </> 
  );
}

export default App;
